import React from 'react'
// import Home from './components/Home';
let Home = React.lazy(() => import('./components/Home'));
import NavBar from './components/NavBar';
import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes>
        <Route path="/" element=
          {
            <React.Suspense>
              <Home />
            </React.Suspense>
          } />
      </Routes>
    </BrowserRouter>
  )
}

export default App
